import { GenIcon } from "react-icons";
import { Link } from "react-router-dom";
function Header() {
  const NavItems = [
    {
      title: "Login",
      link: "login",
      icon: <GenIcon />,
    },
    {
      title: "User",
      link: "user",
      //   icon: <FaUser />,
    },
  ];

  return (
    <header className="">
      <div>
        <Link to="/">
          Taskerr
          <GenIcon />
        </Link>
      </div>
      <ul>
        {NavItems.map((item, idx) => (
          <li>{item.title}</li>
        ))}
      </ul>
    </header>
  );
}

export default Header;
